import React from 'react'

import { Container } from 'react-bootstrap'
import SubmitMemory from '../components/SubmitMemory'

const CreateScreen = () => {
  return (
    <>
      <Container>
        <SubmitMemory />
      </Container>
    </>
  )
}

export default CreateScreen
